import React from 'react'

const LoginModal = ({ children }) => {
    return (
        <div className={['loginModal', 'active'].join(' ')}>
            <div className="loginModalContent">
                <div><img src="../../img/login/close.svg" alt="" /></div>
                {children}
            </div>
        </div>
    )
}

export default LoginModal
